INSERT INTO `match_list` VALUES ('91', '485', '200', '文昌钓鱼场', '100.00', '13963995556', '2', '文昌渔花苑', '{\"lat\":36.183101096100323,\"lng\":120.4042551416662}', '2018-04-14 06:30:00', '2018-04-14 18:30:00', '1', '100', '100', '青岛文昌阁渔花苑钓场\n4月14号周六放鱼通知               本钓场4月13号周五下午提前放一手吃口猛的鲤鱼1000斤…个体重量2-3斤左右，封塘…4月14号周六早上六点抽号六点半开钓…抽几号坐几号，如有空位可以换钓位…\n周六白天收费100元…夜钓收费60元…周日收费50元，夜钓收费50元…周一至周五收费30元。\n白天、晚上都限杆4.5米垂钓，严禁使用4.5米以上的鱼竿，严禁两只鱼竿同时入水。如果发现直接清户走人钓费不退…\n本钓场有红虫 出售，小米，红虫伴侣，饵料等钓鱼用品 。\n致各位钓友\n本钓场会员卡办理中，200元10次。\n注意\n本钓场可以使用红虫禁止流氓钓，戳窝，使用有毒饵料，人随钓箱走，一人一杆，限杆4.5米,严禁使用超出4.5米的杆子，违规者清户清户走人…严禁把烟头、垃圾等其他物品扔进池塘…请钓友严格遵守，以免造成双方的不愉快。\n联系电话：13963995556                            \n地址：青岛市李沧区重庆中路637号', '青岛文昌阁渔花苑钓场\n4月14号周六放鱼通知               本钓场4月13号周五下午提前放一手吃口猛的鲤鱼1000斤…个体重量2-3斤左右，封塘…4月14号周六早上六点抽号六点半开钓…抽几号坐几号，如有空位可以换钓位…\n周六白天收费100元…夜钓收费60元…周日收费50元，夜钓收费50元…周一至周五收费30元。\n白天、晚上都限杆4.5米垂钓，严禁使用4.5米以上的鱼竿，严禁两只鱼竿同时入水。如果发现直接清户走人钓费不退…\n本钓场有红虫 出售，小米，红虫伴侣，饵料等钓鱼用品 。\n致各位钓友\n本钓场会员卡办理中，200元10次。\n注意\n本钓场可以使用红虫禁止流氓钓，戳窝，使用有毒饵料，人随钓箱走，一人一杆，限杆4.5米,严禁使用超出4.5米的杆子，违规者清户清户走人…严禁把烟头、垃圾等其他物品扔进池塘…请钓友严格遵守，以免造成双方的不愉快。\n联系电话：13963995556                            \n地址：青岛市李沧区重庆中路637号', '[\"match\\/201804\\/2\\/LbXWat6CLfc0Y8aVNdyYXBkmsDCs2IPG4mX7Buej.jpeg\",\"match\\/201804\\/2\\/9RR3XplFfRWkr0ncpT3FmiLQL1R4h9avEgewAx7E.jpeg\",\"match\\/201804\\/2\\/EMIoFdcyGQFOZRxvRCnsXg2K5K8n8knmVQbdzRhF.jpeg\"]', '1200', '0', '2018-04-12 14:20:00');
INSERT INTO `match_list` VALUES ('92', '148', '200', '青岛天才渔具淡钓基地', '100.00', '15698167077', '2', '李沧区沧口水上公园(正定一路西)', '{\"lat\":36.177035137701758,\"lng\":120.40191110181961}', '2018-04-14 07:00:00', '2018-04-14 18:00:00', '1', '35', '35', '青岛天才淡钓基地放鱼通知\r     青岛天才淡钓基地周六放鱼通知：4.13日周五下午17点南塘现场过磅放.鱼1000斤封塘,其中500斤鲤鱼500斤鲫鱼（放鱼附带视频及相片），周六早7点统一电子抽签，先交费后抽号，感觉钓位不好可随时更换，白天收费100元/人，夜钓70元/人，周日收费60元，其他时间收费50元，60岁以上及办卡有优惠，现场有收鱼的；；黑坑钓场大小2亩共32个钓位，周六白天限杆3.9以下，其他时间4.8米以下，一人一杆严禁戳窝，饵料不限，白天6点-18点、夜钓18点-早6点，望广大钓友遵守垂钓时间，为维护公园卫生，请将垃圾放入垃圾袋及垃圾箱内，本店出售天津红虫，量大优惠！优惠卡继续办理中！池塘已放花白鲢、草鱼、青鱼等鱼苗，钓到鱼苗请放回，谢谢大家的配合！！\r备注：中午给钓友们准备的水饺，数量不多，有需要的请提前预定！ \r地址：李沧区水上公园 电话：13780609888', '青岛天才淡钓基地放鱼通知\r     青岛天才淡钓基地周六放鱼通知：4.13日周五下午17点南塘现场过磅放.鱼1000斤封塘,其中500斤鲤鱼500斤鲫鱼（放鱼附带视频及相片），周六早7点统一电子抽签，先交费后抽号，感觉钓位不好可随时更换，白天收费100元/人，夜钓70元/人，周日收费60元，其他时间收费50元，60岁以上及办卡有优惠，现场有收鱼的；；黑坑钓场大小2亩共32个钓位，周六白天限杆3.9以下，其他时间4.8米以下，一人一杆严禁戳窝，饵料不限，白天6点-18点、夜钓18点-早6点，望广大钓友遵守垂钓时间，为维护公园卫生，请将垃圾放入垃圾袋及垃圾箱内，本店出售天津红虫，量大优惠！优惠卡继续办理中！池塘已放花白鲢、草鱼、青鱼等鱼苗，钓到鱼苗请放回，谢谢大家的配合！！\r备注：中午给钓友们准备的水饺，数量不多，有需要的请提前预定！ \r地址：李沧区水上公园 电话：13780609888', '[\"match\\/201804\\/2\\/97wONusmEaeQ6YTpT0dmpIJ4io3R01y7PD4g48sU.jpeg\",\"match\\/201804\\/2\\/h2msv1P8G8e9D1AKV9ZdjrMjwPTCwHk93otUtRlL.jpeg\",\"match\\/201804\\/2\\/S00naO123nHh47vdhfmMgPm5vKIN6P6U7CAONp56.jpeg\",\"match\\/201804\\/2\\/e2ql3MADAsllfANSkUko7hHLHbIwySGx5Auasptp.jpeg\",\"match\\/201804\\/2\\/1pKoX0ijosw8F2TFC2ZR4h2SdWLZEsObgUzrO1N5.jpeg\",\"match\\/201804\\/2\\/WZNAjCA9zFi6AeMhfiAxDphfAEASumGtyi9tOZkF.jpeg\",\"match\\/201804\\/2\\/UbUH6drJeprNy32TOU4JATyEO5HlSTMbKdbjsyBr.jpeg\",\"match\\/201804\\/2\\/I8kyK8EcUXVrcawHgrRum15koEykPJk5dOU4wZos.jpeg\",\"match\\/201804\\/2\\/JR1XCuvuIgithmnBk7MRVjsE00K6cs9oaIxbaJVH.jpeg\"]', '1000', '0', '2018-04-12 15:18:24');
