INSERT INTO `match_list` VALUES ('119', '31', '0', '太原大花塔大明鱼塘', '500.00', '13038002367', '18', '山西省体育主题公园(太原市晋源区)', '{\"lat\":37.717153466031107,\"lng\":112.46211515994}', '2018-05-05 06:00:00', '2018-05-05 18:00:00', '1', '66', '66', '太原花塔大明鱼塘 已经正式开钓 现有鲤鱼不低于六万五千斤左右钓友们心里都有数，就是有密度，每星期六日放3000斤，朋友们想过瘾的抓紧安排时间\n     规则不变[愉快]六点售票 七点进场垂钓随便坐，上午11点30收鱼下午5点收鱼《收鱼3块》，6点收杆。\n本钓场环境  一流  坐拥六十六个钓位！\n规则：限杆3.9米，一票一杆，票价：500元[微笑]保底100斤。\n5月1号开始夜钓票价300.时间为下午6点到11点[愉快]保低50斤。                  \n底钩到把不超50CM，禁用流氓漂（限70公分）禁流氓杆.禁用锚钩串钩.禁用红虫，违反规定者，清户出场，鱼票不退。\n        黑坑有风险，下杆需谨慎。大明花塔鱼塘的宗旨：让你钓到手软[微笑]钓到腰困钓到不敢相信自己（望大家自律严格遵守规定，互相监督。）最终解释权归大明垂钓园所有！。                                     \n 电话:13038002367《禁止黑坑鱼护〉', '太原花塔大明鱼塘 已经正式开钓 现有鲤鱼不低于六万五千斤左右钓友们心里都有数，就是有密度，每星期六日放3000斤，朋友们想过瘾的抓紧安排时间\n     规则不变[愉快]六点售票 七点进场垂钓随便坐，上午11点30收鱼下午5点收鱼《收鱼3块》，6点收杆。\n本钓场环境  一流  坐拥六十六个钓位！\n规则：限杆3.9米，一票一杆，票价：500元[微笑]保底100斤。\n5月1号开始夜钓票价300.时间为下午6点到11点[愉快]保低50斤。                  \n底钩到把不超50CM，禁用流氓漂（限70公分）禁流氓杆.禁用锚钩串钩.禁用红虫，违反规定者，清户出场，鱼票不退。\n        黑坑有风险，下杆需谨慎。大明花塔鱼塘的宗旨：让你钓到手软[微笑]钓到腰困钓到不敢相信自己（望大家自律严格遵守规定，互相监督。）最终解释权归大明垂钓园所有！。                                     \n 电话:13038002367《禁止黑坑鱼护〉', '[\"match\\/201805\\/1\\/O8i6r6bxaER2BhGcwRlwHI1OoKyBK9DlL7425RIO.jpeg\",\"match\\/201805\\/1\\/gUv39NXz0C7WEGNFXVvr9Va27XcVVAQU0B9UHgbB.jpeg\",\"match\\/201805\\/1\\/VB97ggAVf0q8Xjkflt5dz9fc0IUBoBYuBG7EQLq0.jpeg\"]', '3000', '1', '2018-05-04 10:17:57');
