INSERT INTO `match_list` VALUES ('121', '31', '200', '左云县洗煤场鱼塘', '300.00', '13603526658', '19', '猪儿洼村(大同市左云县张家场乡猪儿洼村)', '{\"lat\":40.103864004962688,\"lng\":112.853726328706}', '2018-05-05 07:30:00', '2018-05-05 18:00:00', '1', '80', '80', '鱼汛：好消息左云县猪儿哇（洗煤场鱼塘）定于5月5日星期六开业，开业前天放东北精品鲤鱼3000斤，钓费300元，早晨7点抽号，7.30开钓。4号下午提前放鱼质量数量你放心，放鱼现场印客当场直播。一、开业当天设总重量奖，名次取总重量前5名，奖品有鱼竿杆包等，奖品由大同钓协、棚户区小邓渔具，以及左云钓协赞助！\n第一名奖精品鱼竿一支，价值880元，第二名第三名，第四名各奖价值680精品鱼竿一支，第五名奖鱼竿包一个。二、开业当天设标鱼50尾，1-5号黄标钓鱼裤5条由大同钓协石磊赞助，6-20号15根高档芦苇浮漂，由大同市新华渔具店段总赞助。21-30号黄标，4海传奇小药由左云小白渔具赞助，红标31-50号为50元代金卷20张，。中午11.30称重颁奖，颁奖以后未出标鱼以抽号的方式全部抽出，代金券不参与抽奖。三、开业当天限杆4.8米，可虫，铅皮带窝，鱼塘收鱼3元一斤，鱼塘有红虫鱼饵鱼线等。四、开业当天午饭免费，开业当天吃饭人较多要提前准备饭菜，望大家提前报名。五、鱼塘地址左云县猪儿洼村东200米，鱼塘电话13191288557\n13603526658\n18636234629', '鱼汛：好消息左云县猪儿哇（洗煤场鱼塘）定于5月5日星期六开业，开业前天放东北精品鲤鱼3000斤，钓费300元，早晨7点抽号，7.30开钓。4号下午提前放鱼质量数量你放心，放鱼现场印客当场直播。一、开业当天设总重量奖，名次取总重量前5名，奖品有鱼竿杆包等，奖品由大同钓协、棚户区小邓渔具，以及左云钓协赞助！\n第一名奖精品鱼竿一支，价值880元，第二名第三名，第四名各奖价值680精品鱼竿一支，第五名奖鱼竿包一个。二、开业当天设标鱼50尾，1-5号黄标钓鱼裤5条由大同钓协石磊赞助，6-20号15根高档芦苇浮漂，由大同市新华渔具店段总赞助。21-30号黄标，4海传奇小药由左云小白渔具赞助，红标31-50号为50元代金卷20张，。中午11.30称重颁奖，颁奖以后未出标鱼以抽号的方式全部抽出，代金券不参与抽奖。三、开业当天限杆4.8米，可虫，铅皮带窝，鱼塘收鱼3元一斤，鱼塘有红虫鱼饵鱼线等。四、开业当天午饭免费，开业当天吃饭人较多要提前准备饭菜，望大家提前报名。五、鱼塘地址左云县猪儿洼村东200米，鱼塘电话13191288557\n13603526658\n18636234629', '[\"match\\/201805\\/1\\/SxZRCrR7DK6HgFlOOX6V7aOOvfPdJ3fxXWJZ3dL0.jpeg\",\"match\\/201805\\/1\\/cU7mGaN5TZMXuhGvrUbCD3od7tNcy2BAnX5BUyi9.jpeg\",\"match\\/201805\\/1\\/cbCQkM087bAjqaLKl9EbrXjsjrO0Tuy4uV2UD5h7.jpeg\",\"match\\/201805\\/1\\/Q3jcG0aYihQgCCK3bbQdvKkH9gB1sPQ7Y5EYaPxM.jpeg\"]', '3000', '0', '2018-05-04 12:22:47');
INSERT INTO `match_list` VALUES ('122', '31', '200', '阳曲天池垂钓园', '200.00', '15034141000', '18', '阳曲站(太原市阳曲县新阳东街站前巷)', '{\"lat\":38.053505310915668,\"lng\":112.68945514753121}', '2018-05-05 06:00:00', '2018-05-05 18:27:00', '1', '80', '80', '阳曲天池垂钓园\n天池垂钓园位于太原市阳曲县城中社村南的一处天然小型水域，钓场风景秀丽，空气清新，犹如天然氧吧，水源来自天然地下泉水，水质优良，近几年来一直为内部垂钓娱乐场所，该水域原有野生白鲫、鲤鱼等鱼种，四月十四日开业以来陆续投放鲤鱼鲫鱼两万余斤，每天钓获全部回塘，现在塘内鱼密度非常大。为了广大钓友在五一期间能玩的开心，决定放假三天每天再投放鲤鱼2000斤，欢迎垂钓爱好者前来过瘾，本鱼塘餐厅为大家准备了卫生可口的农家饭菜，钓友们还可以携亲友家人前来露营 烧烤 野餐 游玩。祝钓友和家人们有个愉快的假期！\n星期六5月5日放鲤鱼2-5斤1000斤，[蛋糕]丁贵鱼500斤。\n丁贵鱼没有货换了光板鲤500斤。谅解\n五一已过票价回复。星期一，二，四，五偷馿150会员100\'星期三放鱼800，六，日，放鱼1500@200会员150谢谢大家合作。\n本鱼塘夜钓营业中下午6点~12点夜钓票价100\n内有标签鱼黄色金鲤鱼每条30元。会员有效。会员不参加半票\n咨询热线：15034141000小常（微信同号）\n天池垂钓园是天然泉水水质，为保护环境请大家不要使用红虫、打窝和对水质有害的饵料，\n谢谢大家合作。', '阳曲天池垂钓园\n天池垂钓园位于太原市阳曲县城中社村南的一处天然小型水域，钓场风景秀丽，空气清新，犹如天然氧吧，水源来自天然地下泉水，水质优良，近几年来一直为内部垂钓娱乐场所，该水域原有野生白鲫、鲤鱼等鱼种，四月十四日开业以来陆续投放鲤鱼鲫鱼两万余斤，每天钓获全部回塘，现在塘内鱼密度非常大。为了广大钓友在五一期间能玩的开心，决定放假三天每天再投放鲤鱼2000斤，欢迎垂钓爱好者前来过瘾，本鱼塘餐厅为大家准备了卫生可口的农家饭菜，钓友们还可以携亲友家人前来露营 烧烤 野餐 游玩。祝钓友和家人们有个愉快的假期！\n星期六5月5日放鲤鱼2-5斤1000斤，[蛋糕]丁贵鱼500斤。\n丁贵鱼没有货换了光板鲤500斤。谅解\n五一已过票价回复。星期一，二，四，五偷馿150会员100\'星期三放鱼800，六，日，放鱼1500@200会员150谢谢大家合作。\n本鱼塘夜钓营业中下午6点~12点夜钓票价100\n内有标签鱼黄色金鲤鱼每条30元。会员有效。会员不参加半票\n咨询热线：15034141000小常（微信同号）\n天池垂钓园是天然泉水水质，为保护环境请大家不要使用红虫、打窝和对水质有害的饵料，\n谢谢大家合作。', '[\"match\\/201805\\/1\\/aD9XMbfSoccuqdBVp8IdjkQDc2gMNcibCds2EQ8t.jpeg\",\"match\\/201805\\/1\\/O3nbLNkIpiaRk7l9EwmyG2vtyjqWZ0hPH8XEcJn1.jpeg\"]', '1500', '0', '2018-05-04 12:37:02');
INSERT INTO `match_list` VALUES ('123', '31', '200', '太原花塔大明鱼塘', '500.00', '13038002367', '18', '山西省体育主题公园(太原市晋源区)', '{\"lat\":37.716868534056147,\"lng\":112.4621141326049}', '2018-05-05 06:00:00', '2018-05-05 18:00:00', '1', '66', '66', '太原花塔大明鱼塘 已经正式开钓 现有鲤鱼不低于六万五千斤左右[微笑]钓友们心里都有数，就是有密度，每星期六日放3000斤，朋友们想过瘾的抓紧安排时间。\n     规则不变六点售票 七点进场垂钓随便坐，上午11点30收下午5点收鱼《收鱼3块》，6点收杆。\n       本钓场环境  一流  坐拥六十六个钓位！\n    规则：限杆3.9米，一票一杆，票价：500元[微笑]保底100斤。\n      5月1号开始夜钓票价300.时间为下午6点到11点保低50斤。                  \n           底钩到把不超50CM，禁用流氓漂（限70公分）禁流氓杆.禁用锚钩串钩.禁用红虫，违反规定者，清户出场，鱼票不退。\n        黑坑有风险，下杆需谨慎。大明花塔鱼塘的宗旨：让你钓到手软[微笑]钓到腰困[微笑]钓到不敢相信自己[晕]（望大家自律严格遵守规定，互相监督。）最终解释权归大明垂钓园所有！。                                     \n 电话:13038002367  《禁止黑坑鱼护〉〉', '太原花塔大明鱼塘 已经正式开钓 现有鲤鱼不低于六万五千斤左右[微笑]钓友们心里都有数，就是有密度，每星期六日放3000斤，朋友们想过瘾的抓紧安排时间。\n     规则不变六点售票 七点进场垂钓随便坐，上午11点30收下午5点收鱼《收鱼3块》，6点收杆。\n       本钓场环境  一流  坐拥六十六个钓位！\n    规则：限杆3.9米，一票一杆，票价：500元[微笑]保底100斤。\n      5月1号开始夜钓票价300.时间为下午6点到11点保低50斤。                  \n           底钩到把不超50CM，禁用流氓漂（限70公分）禁流氓杆.禁用锚钩串钩.禁用红虫，违反规定者，清户出场，鱼票不退。\n        黑坑有风险，下杆需谨慎。大明花塔鱼塘的宗旨：让你钓到手软[微笑]钓到腰困[微笑]钓到不敢相信自己[晕]（望大家自律严格遵守规定，互相监督。）最终解释权归大明垂钓园所有！。                                     \n 电话:13038002367  《禁止黑坑鱼护〉〉', '[\"match\\/201805\\/1\\/jfgvdO09NGtW9QhOfZafVmj9fEdWvgI1S4EozzQj.jpeg\",\"match\\/201805\\/1\\/oPxCRdiCAa1CnO9eIIdIUUkIWCYrq3FqlL63jU5J.jpeg\",\"match\\/201805\\/1\\/dljEHUTQ61QcFHsNDXMW8FnZk3L56FBezKmTlpzR.jpeg\",\"match\\/201805\\/1\\/3yOsGRGAuDOjI70tqMhpAxYByo1o30UAfOvIiCGE.jpeg\"]', '3000', '0', '2018-05-04 18:11:46');
