INSERT INTO `match_list` VALUES ('137', '1889', '200', '新泰元垂钓园', '200.00', '15044985999', '18', '进贤庄园', '{\"lat\":37.715800000000002,\"lng\":112.49144}', '2018-05-12 06:00:00', '2018-05-12 17:30:00', '1', '67', '67', '新泰元垂钓园（原润泽鱼塘）渔讯\n新泰元垂钓园定于5月5号星期六开业到现在一直封塘加强设施设备建设，新人，新水，新塘，塘子40Ⅹ70米，平底子，低鱼拥有五千来斤，《开口好的你都不相信》，\n[抱拳][抱拳][抱拳]为感谢钓友们大力支持及厚爱，五月12日，加放新鱼2000斤，票价200元，我们将实行抽钓位，其次，为了更好的活跃钓鱼气氛，抽到钓位号为8号18号28号38号48号58号的幸运者，均赠送由《源和渔具》提供价值100元的浮漂一支，特别感谢源和渔具大力支持，\n[抱拳]限杆4.8米，一票一杆，单人单抄不许代抄鱼，严禁使用红虫活饵，不能打窝，文明钓鱼，纯素坑。\n严禁使用黑坑护，严禁锚鱼，严禁窜钓位，严禁使用倒刺钩子\n收鲤鱼2.5元\n下午收鱼5点，\n由于人员有限，请凉解\n早6:00点开门抽号6:30调漂，7点放鱼\n晚5:30点收杆\n暂时不开夜钓，望凉解。\n《本塘鲤鱼为绝对一手鲤鱼口好的程度让你无法想象，真正做到让大家玩好过瘾》\n我们不做第一，但求只做最好。\n地址:新晋祠路上晋源南街（康陪石材城对面300米进贤山庄院内），导航《进贤山庄院内即到》\n电话:15044985999小王\n微信号同手机号，\n备注:严禁使用红虫，发现就没有兄弟们的情义，提尝文明垂钓，快乐垂钓。', '新泰元垂钓园（原润泽鱼塘）渔讯\n新泰元垂钓园定于5月5号星期六开业到现在一直封塘加强设施设备建设，新人，新水，新塘，塘子40Ⅹ70米，平底子，低鱼拥有五千来斤，《开口好的你都不相信》，\n[抱拳][抱拳][抱拳]为感谢钓友们大力支持及厚爱，五月12日，加放新鱼2000斤，票价200元，我们将实行抽钓位，其次，为了更好的活跃钓鱼气氛，抽到钓位号为8号18号28号38号48号58号的幸运者，均赠送由《源和渔具》提供价值100元的浮漂一支，特别感谢源和渔具大力支持，\n[抱拳]限杆4.8米，一票一杆，单人单抄不许代抄鱼，严禁使用红虫活饵，不能打窝，文明钓鱼，纯素坑。\n严禁使用黑坑护，严禁锚鱼，严禁窜钓位，严禁使用倒刺钩子\n收鲤鱼2.5元\n下午收鱼5点，\n由于人员有限，请凉解\n早6:00点开门抽号6:30调漂，7点放鱼\n晚5:30点收杆\n暂时不开夜钓，望凉解。\n《本塘鲤鱼为绝对一手鲤鱼口好的程度让你无法想象，真正做到让大家玩好过瘾》\n我们不做第一，但求只做最好。\n地址:新晋祠路上晋源南街（康陪石材城对面300米进贤山庄院内），导航《进贤山庄院内即到》\n电话:15044985999小王\n微信号同手机号，\n备注:严禁使用红虫，发现就没有兄弟们的情义，提尝文明垂钓，快乐垂钓。', '[\"match\\/201805\\/2\\/dKCWkWRpTZnv5Qqqohot9tUbD2M3wekAqfpszk75.jpeg\"]', '2000', '0', '2018-05-11 11:38:27');
INSERT INTO `match_list` VALUES ('138', '31', '0', '望都金塘垂钓基地', '500.00', '13473223023', '33', '金塘垂钓基地', '{\"lat\":38.67142268958905,\"lng\":115.1787581431126}', '2018-05-20 07:30:00', '2018-05-20 15:30:00', '1', '500', '500', '望都金塘垂钓基地\n望都金塘垂钓基地（京南第一钓）位于望都县G4京港澳高速引线新107国道西行一公里路北(下高速五分钟即到），占地面积一百亩，水域面积六十亩，长236米，宽160米。设有500个钓位。中间有浮桥，四个角和桥底均有照片，坑底平坦无坑洼，做到不偏坑,纯素坑，限杆4.5米，电子排号，对号入座，钓位每人500元，浮桥每人600元， 只允许使用本塘的原塘颗粒打窝，禁止手抛窝，铅坠带窝。如发现违规者罚款一万，自钓自抄，新坑新水，投放鲤鱼30吨，连放三天，收鱼3.5元，钓鱼位间隔2.5米，禁止倒票，发现罚款三千元。\n      垂钓基地位置交通方便，配套设施齐全，WIFI全覆盖。园内设有超市、餐厅、渔具店、临休房等配套设施。拥有停车位600个，吃住方便，停车安全。钓友可以直接把车开到钓位。垂钓基地位于苗圃中心位置，四周无污染。环境幽雅，空气清新，是您休闲垂钓的好去处。 \n金塘垂钓基地计划于2018年5月20日开业，开杆时间早上7.：30—下午3：30收杆，到点停钓。我们的宗旨是踏踏实实做人，实实在在放鱼，欢迎全国各地钓鱼爱好者前来参观休闲。\n本钓场不退票不签票解释权由金塘垂钓基地所有。\n咨询热线：0312-7769999\n134 7322 3023（同微信） 134 8322 3023（同微信）\n131 6557 7065（同微信） 131 6557 5717（同微信）', '望都金塘垂钓基地\n望都金塘垂钓基地（京南第一钓）位于望都县G4京港澳高速引线新107国道西行一公里路北(下高速五分钟即到），占地面积一百亩，水域面积六十亩，长236米，宽160米。设有500个钓位。中间有浮桥，四个角和桥底均有照片，坑底平坦无坑洼，做到不偏坑,纯素坑，限杆4.5米，电子排号，对号入座，钓位每人500元，浮桥每人600元， 只允许使用本塘的原塘颗粒打窝，禁止手抛窝，铅坠带窝。如发现违规者罚款一万，自钓自抄，新坑新水，投放鲤鱼30吨，连放三天，收鱼3.5元，钓鱼位间隔2.5米，禁止倒票，发现罚款三千元。\n      垂钓基地位置交通方便，配套设施齐全，WIFI全覆盖。园内设有超市、餐厅、渔具店、临休房等配套设施。拥有停车位600个，吃住方便，停车安全。钓友可以直接把车开到钓位。垂钓基地位于苗圃中心位置，四周无污染。环境幽雅，空气清新，是您休闲垂钓的好去处。 \n金塘垂钓基地计划于2018年5月20日开业，开杆时间早上7.：30—下午3：30收杆，到点停钓。我们的宗旨是踏踏实实做人，实实在在放鱼，欢迎全国各地钓鱼爱好者前来参观休闲。\n本钓场不退票不签票解释权由金塘垂钓基地所有。\n咨询热线：0312-7769999\n134 7322 3023（同微信） 134 8322 3023（同微信）\n131 6557 7065（同微信） 131 6557 5717（同微信）', '[\"match\\/201805\\/2\\/gD29Xchp8Q2MOtBkYNWx2BjhdPfQBeMkIXChhu5S.jpeg\",\"match\\/201805\\/2\\/ffc0hdEHDufLUbXvwGLLEri3MTNJgQCfPbKFAHM7.jpeg\",\"match\\/201805\\/2\\/WILksurzWd8uuuX2swtUHkDnyZL6N88zCZ5VTocO.jpeg\"]', '30000', '1', '2018-05-13 20:40:13');
